import React from "react"
import './css/App.css';
import MyTimer from './components/MyTimer'

const App = () => {



  return (
    <div className="App">
      <header className="App-header">
        <h1 className="App-title">RDE VeriTest (Dev)</h1>
        <MyTimer />
      </header>
    </div>
  );

};

export default App;
